description:
Surviving horror games is one thing, surviving Creator Confessions is another. Do you think these gamers will make it through? 

From screaming through VR terror to which characters would be on their ‘Hear Me Out’ cake, these horror gamers spill their deepest confessions. They’ll reveal the scariest games they’ve ever played, the jumpscares that left them shaken, and whether they’ve ever faked their fearful reactions.

